import React from "react";


const Review = () => {
  return (
    <div className="container">
      
      <div className="pizza-image-container">
        <img src="/assets/review.png" alt="Pizza" className="pizza-image" />
        <img src="/assets/pizzaicon.png" alt="Pizza Hut Icon" className="pizzahut-icon" />
      </div>

      
      <div className="delivery-info">
        <h2>4102 Pretty View Lanenda</h2>
        <p>Order Delivered</p>
        <p>Please Rate Delivery Service</p>
        <div className="rating-buttons">
          <button className="button good">Good</button>
          <button className="button write-review">Write Review</button>
        </div>
        <button className="button submit">SUBMIT</button>
      </div>
    </div>
  );
};

export default Review;
